pragma solidity 0.5.11;

import "./InternalContract.sol";

contract testFaucet {
    SponsorWhitelistControl internal_sponsor_faucet = SponsorWhitelistControl(
        0x0888000000000000000000000000000000000001
    );

    constructor() public payable {}

    function applyGC(address dapp) public {
        internal_sponsor_faucet.setSponsorForGas.value(1000 ether)(
            dapp,
            1 ether
        );
        internal_sponsor_faucet.setSponsorForCollateral.value(100 ether)(dapp);
    }

    function applyCG(address dapp) public {
        internal_sponsor_faucet.setSponsorForCollateral.value(100 ether)(dapp);
        internal_sponsor_faucet.setSponsorForGas.value(1000 ether)(
            dapp,
            1 ether
        );
    }

    function applyForGas(address dapp) public returns (uint256) {
        internal_sponsor_faucet.setSponsorForGas.value(1000 ether)(
            dapp,
            1 ether
        );
        uint256 r = internal_sponsor_faucet.getSponsoredBalanceForGas(dapp);
        return r;
    }

    function applyForCollateral(address dapp) public returns (uint256) {
        internal_sponsor_faucet.setSponsorForCollateral.value(100 ether)(dapp);
        uint256 r = internal_sponsor_faucet.getSponsoredBalanceForCollateral(
            dapp
        );
        return r;
    }
}
